#!/bin/bash

YELLOW="\e[1;33m"
BLUE_FONT="\e[1;34m"
GREEN_FONT="\e[0;32m"
WHITE_FONT="\e[1;37m"
RED_FONT="\e[1;31m"
RESET_COLOR_FONT="\e[39m"
RESET_ALL="\e[0m"

SPACES="  "
FORMAT_TEXT="%-30s"

checker_mac="./checkers/checker_mac"
checker_linux="./checkers/checker_linux"
checker_bonus="./checker"

worst_case=0
best_case=2147483646
average_case=0
number_tests=0
total_ins=0

simple_test__function() {
		comand=$1
		lines=$(./push_swap $1 | wc -l)
		if [ "$lines" -gt "$worst_case" ]; then
   			worst_case=$lines
		fi
		if [ "$best_case" -gt "$lines" ]; then
   			best_case=$lines
		fi
		total_ins=$((total_ins + lines))
		number_tests=$((number_tests + 1))
		result=$(./push_swap $1 | $checker $1)
		printf "${SPACES}${WHITE_FONT}${FORMAT_TEXT}${RESET_ALL}" "TEST: ./push_swap 500 random numbers: "
		if [ "$result" = "OK" ]; then
			printf "\t${GREEN_FONT}OK${RESET_ALL}"
		else
			printf "\t${RED_FONT}KO${RESET_ALL}"
		fi
		printf "\t${BLUE_FONT}INTRUCTIONS:${RESET_ALL}${YELLOW}\t$lines${RESET_ALL}\n"
	}

echo ""
printf "**********************************************************************************\n"
printf "*                                                                                *\n"
printf "*                               ${BLUE_FONT}500_TEST PUSH_SWAP${RESET_ALL}                               *\n"
printf "*                                                                                *\n"
printf "**********************************************************************************\n\n\n"



printf "CHECKER: $checker\n\n"


printf "\n${GREEN_FONT}500_NUMBERS\n${RESET_ALL}\n"

